import React from "react";

const ArticlePage = ({ match }) => {
  const name = match.params.name;
  return (
    <React.Fragment>
      <header>
        <div class="content-wrap">
          <h1 class="fancy">This is an {name} article. </h1>
        </div>
      </header>
    </React.Fragment>
  );
};

export default ArticlePage;
